import React from 'react'
import "@fontsource/quantico";
function Homepage() {
  return (
    <div className='flex w-screen h-screen bg--[#3E065F]'>
        <div className='flex flex-row justify-center'>
            <div className='w-1/2 border-r-2'>
                Home
            </div>
        </div>
    </div>
  )
}

export default Homepage
